
public class swap {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int num1 = 10;
		int num2 = 99;
		
		System.out.println("Before Swap method | num1: " + num1 + " and num2: " + num2);
		
		int tmp = num1;
		num1 = num2;
		num2 = tmp;
		
		System.out.println("After Swap method | num1: " + num1 + " and num2: " + num2);
		
	}

}
